        </View>
        <Text style={styles.bio}>
            O mundo no brasidaslasd lasda sjadsbn asdbasd babnasdda { '\n' }
            dasads asd assd ads dass
        </Text>
        <View style={styles.footer}>
            <Text style={styles.price}>
                Preço hora {'   '}
                 <Text style={styles.priceValue}>R$ 230,00</Text>
            </Text>
            <View style={styles.buttonContainer}>
                <RectButton style={styles.favoriteButton}></RectButton>
            </View>
        </View>
    </View>
    )
}

export default TeacherItem;
